      'richText': '<p>Subscribe today and you&rsquo;ll receive exclusive discounts
        and benefits. Not only are you guaranteed the lowest price for your chosen
        products, you&rsquo;ll also get free delivery on your recurring orders. Save
        time and effort by ensuring your products are delivered to your door at the
        frequency you decide.</p>


        <p>Signing up for a subscription order is easy - just select the Subscribe
        &amp; Save option on the product page and choose how often you&#39;d like
        it delivered before adding to your basket, and then checkout as normal.</p>

